import React from "react";
import { Link } from "react-router-dom";
import { AppBar, Toolbar, Button } from "@mui/material";

const NavBar = () => {
    return (
        <AppBar position="static">
          <Toolbar sx={{ justifyContent: "center" }}>
            <Button component={Link} to="/" color="default">
              Homepage
            </Button>
            <Button component={Link} to="/companies" color="default">
              Companies
            </Button>
            <Button component={Link} to="/jobs" color="default">
              Jobs
            </Button>
            <Button component={Link} to="/login" color="default">
              Login
            </Button>
            <Button component={Link} to="/signup" color="default">
              Signup
            </Button>
            <Button component={Link} to="/users" color="default">
              Users
            </Button>
            <Button component={Link} to="/profileeditpage" color="default">
              Profile Edit Page
            </Button>
          </Toolbar>
        </AppBar>
      );

};

export default NavBar;
